import React from "react";
import {
	View,
	Text,
	StyleSheet
} from 'react-native';

const EditView = (props) => {
	const {value} = props;
	return(
		<View style={styles.container}>
			<Text style={styles.text}>{value}</Text>
		</View>
	)
};
const styles = StyleSheet.create({
	container: {
		flex:1,
		backgroundColor: 'black'
	},
	text: {color:'white'},
})


export default EditView;
